function LandingPage() {
  return (
    
    <div>
      <button onClick={toggleMenu}>Menu</button>
      {isMenuOpen && (
        <div className="menu">
          <button onClick={() => navigate('/profile')}>Profile Page</button>
          // Other buttons
        </div>
      )}
    </div>
  );
}

export default LandingPage;
